import{o as t,c as e,b as r}from"./app.b2aa9d0b.js";const a='{"title":"th-yoo","description":"","frontmatter":{"lang":"ko-KR","title":"th-yoo","navbar":true,"sidebar":"auto"},"headers":[{"level":2,"title":"VitePress","slug":"vitepress"},{"level":2,"title":"증권사 API","slug":"증권사-api"},{"level":2,"title":"Vultr에 최소한의 Ubuntu 설치","slug":"vultr에-최소한의-ubuntu-설치"},{"level":2,"title":"Wine","slug":"wine"},{"level":2,"title":"Chroot Jail","slug":"chroot-jail"},{"level":2,"title":"Ubuntu상에서의 MSYS2 (TBD)","slug":"ubuntu상에서의-msys2-tbd"},{"level":2,"title":"SU/SUDO, PAM, NSS(TBD)","slug":"su-sudo-pam-nss-tbd"},{"level":2,"title":"React SPA NGINX 설정","slug":"react-spa-nginx-설정"}],"relativePath":"ko/index.md","lastUpdated":1627216183099}',i={},d=r('<h1 id="비망록"><a class="header-anchor" href="#비망록" aria-hidden="true">#</a> 비망록</h1><h2 id="vitepress"><a class="header-anchor" href="#vitepress" aria-hidden="true">#</a> VitePress</h2><ul><li><a href="https://vitepress.vuejs.org/" target="_blank" rel="noopener noreferrer">VitePress</a></li><li><a href="https://miyauchi.dev/posts/start-vitepress" target="_blank" rel="noopener noreferrer">VitePress로 문서 작성</a></li><li><a href="https://daringfireball.net/projects/markdown/" target="_blank" rel="noopener noreferrer">Markdown</a></li><li><a href="https://www.markdownguide.org/cheat-sheet/" target="_blank" rel="noopener noreferrer">Markdown 참고</a></li></ul><h2 id="증권사-api"><a class="header-anchor" href="#증권사-api" aria-hidden="true">#</a> 증권사 API</h2><ul><li><a href="https://aidalab.tistory.com/100" target="_blank" rel="noopener noreferrer">출처</a></li></ul><table><thead><tr><th>증권사</th><th>API 명칭</th><th>OS/방식</th><th>비고</th></tr></thead><tbody><tr><td>키움</td><td>Open API+</td><td>Win/OCX</td><td></td></tr><tr><td>대신</td><td>CYBOS Plus</td><td>Win/COM, Mobile</td><td></td></tr><tr><td>이베스트</td><td>xingAPI</td><td>Win/(DLL,COM), Mobile</td><td></td></tr><tr><td>유안타</td><td>Open API</td><td>Win/(DLL,COM)</td><td></td></tr><tr><td>NH</td><td>QV Open API</td><td>Win/DLL</td><td>나무는 따로</td></tr><tr><td>하나</td><td>1Q Pro</td><td>Win/OCX</td><td></td></tr><tr><td>한투</td><td>eFriend</td><td>Win/OCX, Mobile</td><td></td></tr><tr><td>유진</td><td>API</td><td>Win/(DLL,OCX)</td><td></td></tr></tbody></table><p>국내외 가상 자산 거래소는 Restful이나 JSON-RPC인데 기존 인증서 때문인지 MS Windows 밖에... 당국자는 제발 Metamask, WalletConnect등을 참고하시길 바란다.</p><h2 id="vultr에-최소한의-ubuntu-설치"><a class="header-anchor" href="#vultr에-최소한의-ubuntu-설치" aria-hidden="true">#</a> <a href="./win_bridge_server/">Vultr에 최소한의 Ubuntu 설치</a></h2><ul><li>리모트로만 접속 가능하므로 데스크탑 환경은 필요 없으나 Xterminal, Meld나 Gvim 같이 편리한 툴을 사용하기 위해서 X Window는 필요.</li></ul><h2 id="wine"><a class="header-anchor" href="#wine" aria-hidden="true">#</a> <a href="./win_bridge_server/wine.html">Wine</a></h2><ul><li>Linux에서 PE/COFF(윈도우즈 바이너리)가 실행 가능 <ul><li><a href="https://www.winehq.org/" target="_blank" rel="noopener noreferrer">WINE</a></li></ul></li></ul><h2 id="chroot-jail"><a class="header-anchor" href="#chroot-jail" aria-hidden="true">#</a> <a href="./win_bridge_server/chroot_jail.html">Chroot Jail</a></h2><ul><li>docker는 Virtual Machine만큼은 아니라도 적지 않은 리소스를 차지한다. Image도 작지 않다.</li><li><a href="https://wiki.debian.org/Debootstrap" target="_blank" rel="noopener noreferrer">debootstrap</a>을 이용하거나 <a href="https://packages.ubuntu.com/focal/apt" target="_blank" rel="noopener noreferrer">apt package</a>와 의존 패키지만을 Jail에 설치하여 별도의 시스템을 구축할 수 있다. <ul><li>debootstrap을 이용하여 필자는 과거 갤럭시 탭에 Android는 그대로 놓아 두고 Rooting해서 Chroot Jail에 ARM Debian과 GCC를 설치하여 ARM Native Compile한 적이 있다.</li><li>debootstrap과 qemu-arm-static, binfmt_misc를 이용하여 다른 Architecture(X86, X64, PPC는 요새 보기 힘듬)에서 ARM Linux를 Emulate할 수 있다. 즉, ARM ELF 바이너리가 실행 가능.</li><li>위의 환경에서는 Cross 컴파일을 할 필요가 없거나 Cross 컴파일이라도 Native 환경으로 보이므로 Cross-Compile하기 어렵기로 악명 높은 Python도 쉽게 컴파일 가능하다.</li></ul></li><li>필자의 Chroot Jail은 MSYS2의 빌드 시스템만을 속이고 Wine만을 가둘 목적이므로 외부(호스트)와 대부분을 공유한다.</li></ul><h2 id="ubuntu상에서의-msys2-tbd"><a class="header-anchor" href="#ubuntu상에서의-msys2-tbd" aria-hidden="true">#</a> <a href="./win_bridge_server/msys2.html">Ubuntu상에서의 MSYS2 (TBD)</a></h2><h2 id="su-sudo-pam-nss-tbd"><a class="header-anchor" href="#su-sudo-pam-nss-tbd" aria-hidden="true">#</a> SU/SUDO, PAM, NSS(TBD)</h2><h2 id="react-spa-nginx-설정"><a class="header-anchor" href="#react-spa-nginx-설정" aria-hidden="true">#</a> React SPA NGINX 설정</h2><ul><li>/etc/nginx/conf.d/default.conf</li></ul><div class="language-"><pre><code>server {\n# ...\n\tlocation / {\n\t\troot /home/&lt;USER&gt;/public_html;\n\t\tindex index.html index.htm;\n\t\ttry_files $uri /index.html;\n\t}\n# ...\n</code></pre></div>',18);i.render=function(r,a,i,l,n,o){return t(),e("div",null,[d])};export default i;export{a as __pageData};
